import React from 'react';
import './BrandContainer.css';

const BrandContainer = () => {
    return (
    <div className="brand-container">
        <img src="./img/blood-drop.png" alt="logo" className="logo"/>
        <h1>dailyMeasure</h1>
    </div>
    );
}

export default BrandContainer
